import { useState } from "react";

// PC PARTS DATA
const GPUS = {
  "RTX 4090": { name: "RTX 4090", fps: 1.0 },
  "RTX 4080": { name: "RTX 4080", fps: 0.85 },
  "RX 7900 XTX": { name: "RX 7900 XTX", fps: 0.83 },
};

const CPUS = {
  "RYZEN 9": { name: "RYZEN 9", fps: 1.0 },
  "RYZEN 7": { name: "RYZEN 7", fps: 0.85 },
  "RYZEN 5": { name: "RYZEN 5", fps: 0.7 },
};

const RAMS = {
  "16GB DDR5": { name: "16GB DDR5", fps: 0.95 },
  "32GB DDR5": { name: "32GB DDR5", fps: 1.0 },
  "64GB DDR5": { name: "64GB DDR5", fps: 1.02 },
};

const MOBOS = {
  "B650": { name: "B650", fps: 1.0 },
  "B870": { name: "B870", fps: 1.0 },
  "X870E": { name: "X870E", fps: 1.0 },
};

function App() {
  const [selectedGPU, setSelectedGPU] = useState(null);
  const [selectedCPU, setSelectedCPU] = useState(null);
  const [selectedMOBO, setSelectedMOBO] = useState(null);
  const [selectedRAM, setSelectedRAM] = useState(null);

  const estimatedFPS =
    selectedGPU && selectedCPU && selectedRAM
      ? Math.round(
          200 * selectedGPU.fps * selectedCPU.fps * selectedRAM.fps
        )
      : null;

  const cardStyle = {
    background: "#f5f5f5",
    padding: "20px",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
    marginBottom: "20px",
  };

  const selectStyle = {
    padding: "8px 12px",
    fontSize: "16px",
    borderRadius: "6px",
    border: "1px solid #ccc",
    marginTop: "6px",
    marginBottom: "12px",
    width: "100%",
    boxSizing: "border-box",
  };

  return (
    <div style={{ padding: "40px", fontFamily: "Arial, sans-serif", maxWidth: "500px", margin: "auto" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>PC Performance Builder</h1>

      {/* GPU */}
      <div style={cardStyle}>
        <p style={{ fontWeight: "bold" }}>Select your GPU:</p>
        <select
          style={selectStyle}
          value={selectedGPU?.name || ""}
          onChange={(e) => setSelectedGPU(GPUS[e.target.value] || null)}
        >
          <option value="">-- Choose a GPU --</option>
          {Object.keys(GPUS).map((gpu) => (
            <option key={gpu} value={gpu}>
              {gpu}
            </option>
          ))}
        </select>
        {selectedGPU && <p>You selected: <strong>{selectedGPU.name}</strong></p>}
      </div>

      {/* CPU */}
      <div style={cardStyle}>
        <p style={{ fontWeight: "bold" }}>Select your CPU:</p>
        <select
          style={selectStyle}
          value={selectedCPU?.name || ""}
          onChange={(e) => setSelectedCPU(CPUS[e.target.value] || null)}
        >
          <option value="">-- Choose a CPU --</option>
          {Object.keys(CPUS).map((cpu) => (
            <option key={cpu} value={cpu}>
              {cpu}
            </option>
          ))}
        </select>
        {selectedCPU && <p>You selected: <strong>{selectedCPU.name}</strong></p>}
      </div>

      {/* Motherboard */}
      <div style={cardStyle}>
        <p style={{ fontWeight: "bold" }}>Select your Motherboard:</p>
        <select
          style={selectStyle}
          value={selectedMOBO?.name || ""}
          onChange={(e) => setSelectedMOBO(MOBOS[e.target.value] || null)}
        >
          <option value="">-- Choose a Motherboard --</option>
          {Object.keys(MOBOS).map((mobo) => (
            <option key={mobo} value={mobo}>
              {mobo}
            </option>
          ))}
        </select>
        {selectedMOBO && <p>You selected: <strong>{selectedMOBO.name}</strong></p>}
      </div>

      {/* RAM */}
      <div style={cardStyle}>
        <p style={{ fontWeight: "bold" }}>Select your RAM:</p>
        <select
          style={selectStyle}
          value={selectedRAM?.name || ""}
          onChange={(e) => setSelectedRAM(RAMS[e.target.value] || null)}
        >
          <option value="">-- Choose RAM --</option>
          {Object.keys(RAMS).map((ram) => (
            <option key={ram} value={ram}>
              {ram}
            </option>
          ))}
        </select>
        {selectedRAM && <p>You selected: <strong>{selectedRAM.name}</strong></p>}
      </div>

      {/* Estimated FPS */}
      {estimatedFPS && (
        <div style={{ ...cardStyle, background: "#dff0d8", textAlign: "center" }}>
          <p style={{ fontWeight: "bold", fontSize: "18px" }}>Estimated FPS:</p>
          <p style={{ fontSize: "24px", margin: "0" }}>{estimatedFPS} FPS</p>
        </div>
      )}
    </div>
  );
}

export default App;
